//components
import Map from '../Map/index'

//Styles
import {Wrapper, Content, Nav, MapContainer} from './Form.styles'
import Api from '../../api'
/* link / navLinkto (to) prop använder invoice number för att ladda sidan med
  rätt id
*/

const Admin = () => {

	const handleSubmit = async (event)  => {
        event.preventDefault();

        try {
            let res = await apisetting.findUser(inputs.username, inputs.psw)
            if (res.data.msg === true) {
                await myContext.setTokenForUser(res.data.token);
                await myContext.authorizedOrNot(true);
                await myContext.setUserLoggedIn(inputs.username);
                history.push("/docs");
            }
        } catch (typeError) {
            alert("Wrong password or username")
        }
    }

return (
    <Wrapper>
        <Content>
			<Nav>
			<button onClick= {
				getBikes()
			}> Hämta cyklar </button>

			</Nav>
			<MapContainer>
				<Map></Map>
			</MapContainer>
        </Content>
    </Wrapper>
  )
}

export default Admin


